import React from 'react'
import "./Home.scss"
import Slider from '../../components/slider/Slider'
import Featured from '../../components/FeaturedProducts/Featured'


export const Home = () => {
  return (
    <div className='home'>
      <Slider/>
      <Featured type="Fetured"/>
      
      <Featured type="Trending"/>

    </div>
  )
}
